import React from "react";
import GrowBanner from "../components/GrowBanner/GrowBanner";

function HomePage() {
  return (
    <div>
      <div className="container">
        <div className="banner-container">
          <GrowBanner />
        </div>
        <div className="fun-facts">
          <h3>Fun Facts About Us</h3>
          <ul>
            <li>We have served over 1000 satisfied customers.</li>
            <li>
              Our marketing campaigns have reached millions of people worldwide.
            </li>
            <li>We've won multiple awards for our innovative strategies.</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
